// hocs/withAuth.js
import { useEffect } from 'react';
import { useNavigate } from "react-router-dom";
import { useUser } from "./s";

export const useAuth = () => {
    const navigate = useNavigate();
    const { state } = useUser();

    useEffect(() => {
        if (!state.user) {
            navigate("/");
        }
    }, [state.user, navigate]);

    return state;
};
